import React from "react";
import { View, Text, TouchableOpacity, Image } from "react-native";
import AboutSectionStyles from "./styles/AboutSectionStyles";

const AboutSection = () => {
  return (
    <View style={AboutSectionStyles.container}>
      <Text style={AboutSectionStyles.title}>
        Let us tell u some things about us
      </Text>
      <View style={AboutSectionStyles.description}>
        <View>
          <Text>
            We are a group of people that have in mind the growth Baia Mare, our
            home city.
          </Text>
          <Text style={AboutSectionStyles.endingText}>
            We are determined to make your business grow!
          </Text>
        </View>
        <Image
          source={require("../../../../assets/desktop-web.jpeg")}
          style={AboutSectionStyles.image}
        />
      </View>
    </View>
  );
};
export default AboutSection;
